const PortfolioSettings = (props) => {

   const handleSubmit = (e) => {
    e.preventDefault()
    console.log(e.currentTarget.value)
   }

    return(
        <div className={props.showSettings ? "portfolio-settings-cont" :  "active-settings portfolio-settings-cont"}>
            <form onSubmit={(e) => handleSubmit(e)}>
                    <fieldset>
                        <legend>What To Show On Load</legend>
                    <label htmlFor="default-setting">Default</label>
                    <input defaultChecked name="settings" id="default-setting" type="radio" value="default"/>
                    <label htmlFor="portfolio-setting">Show Portfolio</label>
                    <input name="settings" id="portfolio-setting" type="radio" value="portfolio"/>
                    <input type="submit" value="Save Settings"/>
                    </fieldset>
            </form>
        </div>
    )
}

export default PortfolioSettings;
